import './App.css';
import CustomNavbar from './components/CustomNavbar/CustomNavbar';
import { AppRouter } from './components/routers/AppRouter';

function App() {
  return (
    <>
    <AppRouter />
    <div className="m-2">
    <CustomNavbar/>
    </div>
    </>
  );
}

export default App;
